class WordFilter:
    # https://leetcode.com/problems/prefix-and-suffix-search/solution/
    # Approach #3: Trie of Suffix Wrapped Words [Accepted]

  def __init__(self, words: List[str]):
    def insert(new_word, weight):
      current = self.trie
      for letter in new_word:
        current = current.setdefault(letter, {})
      current['$'] = weight

    self.trie = {}
    for weight, word in enumerate(words):
      word_len = len(word)
      for i in range(word_len+1):
        new_word = '{}#{}'.format(word[word_len-i:word_len], word)
        insert(new_word, weight)
    pass

  def f(self, prefix: str, suffix: str) -> int:
    def find_node(new_suffix):
      current = self.trie
      for letter in new_suffix:
        current = current.get(letter, None)
        if current is None: return current
      return current

    def find_max(node):
      current = node
      for k, v in current.items():
        if k == '$':
          result[0] = max(result[0], v)
          continue
        find_max(v)

    new_suffix = '{}#{}'.format(suffix, prefix)
    node = find_node(new_suffix)
    if not node: return -1
    result = [-1]
    find_max(node)
    return result[0]


